import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './pages/home/Home';

function App() {
  return (
    <div >
     <Home></Home>
     <BrowserRouter>
     <Routes>
       <Route path='/'></Route>
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
